import coverImage from "../assets/images/coverImage.jpg";

function AboutSection() {
  return (
    <div>
      <div>
        <div>
          <image src={coverImage} alt="Cover"></image>
        </div>
        <div>
          <p></p>
        </div>
      </div>
    </div>
  );
}

export default AboutSection;
